
def hasGroupsSizeX(deck):
    collection={}
    for i in deck:
        if i in collection:
            collection[i]=collection[i]+1
        else:
            collection[i]=1

    cards_group = sorted(list(collection.values()))
    if cards_group[0]<2:
        return False
    count=0
    for divisor in range(2, cards_group[0]+1):
        if cards_group[0]%divisor==0:
            for el in cards_group:
                if el%divisor!=0:
                    count=0
                    break
                else:
                    count+=1
                    if count>=len(cards_group):
                        return True

    return False




